async (fileName, path) => {
		showAlert(`Downloading file: ${fileName}`);
		const name = fileName;
		await storeValue('tempfileName', fileName);
		await downloadQuery.run(()=> {
				download(atob(downloadQuery.data.fileData), appsmith.store.tempfileName);
			}, undefined, {
			path: path
		});
	}

